import React from "react";

function Post() {
  return (
    <div>
      <main>
        <div className="head">
          <div className="container">
            <i className="fas fa-user-circle fa-2x"></i>
            <p> Pranshu Singh</p>
          </div>
        </div>
        <div className="body"></div>
        <div className="foot"></div>
      </main>
    </div>
  );
}

export default Post;
